import React from 'react';
import './App.css';
import HeaderRouteManager from '../components/header/HeaderRouteManager';
import FooterRouteManager from '../components/footer/FooterRouteManager';
import Home from '../components/pages/Home';
import About from '../components/pages/About';
import Pricing from '../components/pages/Pricing';
import OurDifference from '../components/pages/OurDifference';
import Contact from '../components/pages/Contact';
import Login from '../components/pages/Login';
import SignUp from '../components/pages/SignUp';
import FAQ from '../components/pages/FAQ';
import Terms from '../components/pages/Terms';
import Careers from '../components/pages/Careers';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function App() {


  return (
    <div className="App">
      <Router>
        <HeaderRouteManager/>
          <Switch>
            <Route path = '/About' component = {About}/>
            <Route path = '/Pricing' component = {Pricing}/>
            <Route path = '/Our-Difference' component = {OurDifference}/> 
            <Route path = '/Contact' component = {Contact}/>
            <Route path = '/Login' component = {Login}/>
            <Route path = '/Sign-Up' component = {SignUp}/>
            <Route path = '/FAQ/' component = {FAQ}/>
            <Route path = '/Terms' component = {Terms}/>
            <Route path = '/Careers' component = {Careers}/>
            <Route path = '/' component = {Home}/>
          </Switch>
        <FooterRouteManager/>
     </Router> 
    </div>
  );
}

export default App;
